import React from 'react';
import { Link } from 'react-router-dom';

const Header = ({ isMobile }) => {
  return (
    <header className={`fixed top-0 right-0 z-10 h-20 flex items-center justify-between px-4 md:px-8 ${isMobile ? 'left-0' : 'left-64'} transition-all duration-300 bg-transparent backdrop-blur-sm`}>
      <div className="flex items-center space-x-4">
        <img 
          src="/student_council.png" 
          alt="Student Council Logo" 
          className="h-12 md:h-14 w-auto"
        />
      </div>

      <div className="hidden md:flex items-center space-x-6">
        <Link to="/" className="text-text-secondary hover:text-text-primary transition-colors">Home</Link>
        <Link to="/registration" className="text-text-secondary hover:text-text-primary transition-colors">Registration</Link>
        <Link to="/fixtures" className="text-text-secondary hover:text-text-primary transition-colors">Fixtures</Link>
      </div>

      <div>
        <img 
          src="/recharge_logo.png" 
          alt="Recharge Logo" 
          className="h-12 md:h-14 w-auto"
        />
      </div>
    </header>
  );
};

export default Header;
